        public static int HomeNumber = 1000000;
        public static IEnumerable<Home> GetHomes()
        {
            foreach (var province in ProvinceData.GetProvinces())
            {
                foreach (var city in CityData.City())
                {
                    foreach (var surface in SurfaceData.Surface())
                    {
                        for (int i = 1963; i < 2013; i = i + 2)
                        {
                            yield return new Home
                            {
                                BuildYear = i,
                                City = city,
                                Description = "Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.",
                                Price = surface * (2000 * ((double)(1963 - (2013 - 1963)) / 2013)),
                                Surface = surface,
                                HomeProvince = province
                            };
                        }

                    }

                }

            }
        }

